                        <div className='list-item'>
                            <li >{item}</li>

                            <div className='select-cont'>
                               <div className='select'/> 
                                <div className='select'/> 
                                <div className='select'/>  
                            </div>
                            
                        </div>                    
                    )
                    
                })

    return(
                
            <ul className='main-cont'>
                {listItems.length > 0 ? listItems : []}
            </ul>
        
    )
}
